const Checkout = (props) => {
  return (
    <form>
      <label>Your Name</label>
      <input
        type="text"
        // onChange={nameChangeHandler}
        // onBlur={nameBlurHandler}
      />
      <label>Street</label>
      <input type="text" />
      <label>Postal Code</label>
      <input type="text" />
      <label>City</label>
      <input type="text" />
    </form>
  );
};
export default Checkout;
